import React from 'react';

const About = () => {
  return (
    <>
      <header>
        <h1>Adrian Williams</h1>

      </header>
      <main>
        <section class="con">
          <img src="avad.jpg" alt="Avatar" class="pic" />
          <p class="blue">"As a web developer based in Dallas, Texas, I bring a wealth of technical expertise and creativity to every project. With  years oexperience building dynamic, user-friendly websites, I have a proven track record of delivering innovative solutions that drive business growth and enhance user experiences. Whether working with clients to develop custom applications or optimizing existing sites for optimal performance, I am committed to staying at the forefront of the latest web technologies and trends."</p>
        </section>
      </main>
      {/* <footer>
        <a href="#">GitHub</a>
        <a href="#">LinkedIn</a>
        <a href="#">Stack Overflow</a>
      </footer> */}
    </>
  );
};

export default About;
